using log4net;
using PredixCommon;
using PredixCommon.Entities;
using PredixCommon.Entities.EdgeManager;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace DeployDeviceModels
{
    class Program
    {
        private static ILog logger = LogManager.GetLogger(typeof(Program));

        static void Main(string[] args)
        {
            string versionNumber = "1.0";

            logger.Debug("App Started");

            Console.WriteLine("-------------------------------------------");
            Console.WriteLine(" Deploy Device Models v" + versionNumber);
            Console.WriteLine("-------------------------------------------");
            Console.WriteLine();

            string baseUAAUrl = Environment.GetEnvironmentVariable("baseUAAUrl");
            string clientID = Environment.GetEnvironmentVariable("clientID");
            string clientSecret = Environment.GetEnvironmentVariable("clientSecret");
            string edgeManagerBaseUrl = Environment.GetEnvironmentVariable("edgeManagerBaseUrl");
            string csvFilePath = Environment.GetEnvironmentVariable("csvFilePath");

            bool inputValid = true;

            if (string.IsNullOrEmpty(baseUAAUrl))
            {
                string errMsg = string.Format("Base UAA Url parameter is empty");
                logger.Fatal(errMsg);
                Console.WriteLine(errMsg);
                inputValid = false;
            }

            if (string.IsNullOrEmpty(clientID))
            {
                string errMsg = string.Format("Client ID parameter is empty");
                logger.Fatal(errMsg);
                Console.WriteLine(errMsg);
                inputValid = false;
            }

            if (string.IsNullOrEmpty(clientSecret))
            {
                string errMsg = string.Format("Client Secret parameter is empty");
                logger.Fatal(errMsg);
                Console.WriteLine(errMsg);
                inputValid = false;
            }

            if (string.IsNullOrEmpty(edgeManagerBaseUrl))
            {
                string errMsg = string.Format("Edge Manager Base Url parameter is empty");
                logger.Fatal(errMsg);
                Console.WriteLine(errMsg);
                inputValid = false;
            }

            if (string.IsNullOrEmpty(csvFilePath))
            {
                string errMsg = string.Format("CSV Path parameter is empty");
                logger.Fatal(errMsg);
                Console.WriteLine(errMsg);
                inputValid = false;
            }

            if (inputValid)
            {
                try
                {
                    //now execute the async part...              
                    MainAsync(baseUAAUrl, clientID, clientSecret, edgeManagerBaseUrl, csvFilePath).Wait();
                }
                catch (Exception ex)
                {
                    logger.Fatal("Fatal Error see logs for details.", ex);
                    logger.Debug(ex.ToString());

                    Console.WriteLine("There was an error during the execution of the tool.\n" + ex.ToString());
                }
            }
            else
            {
                string errMsg = string.Format("Some parameters is missing. Cannot execute the tool!");
                logger.Fatal(errMsg);
                Console.WriteLine();
                Console.WriteLine(errMsg);
            }
        }

        static async Task MainAsync(string baseUAAUrl, string clientID, string clientSecret, string edgeManagerBaseUrl, string csvFilePath)
        {
            logger.Debug("Entering MainAsync");
           
            List<DeviceModelCSV> deviceModelCSVList;

            try
            {
                using (var csvFileStream = System.IO.File.OpenRead(csvFilePath))
                {
                    using (var csvFileReader = new System.IO.StreamReader(csvFileStream))
                    {
                        using (CsvHelper.CsvReader csvReader = new CsvHelper.CsvReader(csvFileReader))
                        {
                            deviceModelCSVList = csvReader.GetRecords<DeviceModelCSV>().ToList();
                        }
                    }
                }

                Console.WriteLine("CSV parsed properly!");
            }
            catch (Exception ex)
            {
                logger.Fatal("An error occurred reading CSV file.", ex);
                throw;
            }

            //need to fill the Image Dictionary 
            DeviceImagesCatalog.CatalogByDeviceType.Add(DeviceTypeEnum.VCube, new DeviceImages()
                {
                    IconBase64 = @"",
                    PhotoBase64 = @""
                }
            );

            DeviceImagesCatalog.CatalogByDeviceType.Add(DeviceTypeEnum.CubeV1, new DeviceImages()
                {
                    IconBase64 = @"iVBORw0KGgoAAAANSUhEUgAAACAAAAAgCAIAAAD8GO2jAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAA2hpVFh0WE1MOmNvbS5hZG9iZS54bXAAAAAAADw ",
                    PhotoBase64 = @""
                }
            );

            DeviceImagesCatalog.CatalogByDeviceType.Add(DeviceTypeEnum.CubeV2, new DeviceImages()
                {
                    IconBase64 = @"",
                    PhotoBase64 = @""
                }
            );

            if (deviceModelCSVList != null)
            {
                try
                {
                    Console.WriteLine("Getting Access Token for ClientID: " + clientID);

                    UAAToken accessToken = await UAAHelper.GetClientCredentialsGrantAccessToken(baseUAAUrl, clientID, clientSecret);

                    Console.WriteLine("Token obtained!");
                    
                    foreach (var deviceModelCsv in deviceModelCSVList)
                    {
                        var deviceModel = deviceModelCsv.ToDeviceModel();
                        await EdgeManagerHelper.AddOrUpdateDeviceModel(edgeManagerBaseUrl, accessToken, deviceModel);
                    }
                }
                catch (Exception ex)
                {
                    logger.Fatal("An error occurred working with the Cloud.", ex);
                    throw;
                }

            }
            
        }
    }
}